	[101011201] = {
		description = [[
使用镰刀连斩，造成共计<color=#FF9500>{1}</color>攻击力的物理伤害。「禁忌灾刃」处于冷却状态时，可再次点击该技能对自身造成<color=#FF9500>{3}</color>（最多<color=#FF9500>30%</color>）生命值上限的伤害，并额外施放一次「禁忌灾刃」；该次施放的「禁忌灾刃」命中瞬间伤害提高<color=#FF9500>{2}</color>，获得<color=#FF9500>8%</color>的奥义值，每次冷却时间内最多施放一次。
「禁忌灾刃」不会打断普通攻击的连段。

