	[101013101] = {
		description = [[
连续攻击锁定的敌人，造成共计<color=#FF9500>{1}</color>攻击力的火属性伤害。
「虚炎行空」：可通过长按普通攻击施放该技能。贯穿空间施放直线攻击，造成共计<color=#FF9500>220%</color>攻击力的火属性伤害。处于「缚炎」状态时，命中时对敌人附加火属性抗性降低<color=#FF9500>{2}</color>，持续<color=#FF9500>{3}</color>秒。
强化的「虚炎行空」：每次「缚炎」状态结束后会强化下一次的「虚炎行空」，可通过长按普通攻击施放该强化技能。贯穿空间释放重拳，造成共计<color=#FF9500>440%</color>攻击力的火属性伤害。
「虚炎行空」不会打断普通攻击的连段。

