	[101013111] = {
		description = [[
连续攻击锁定的敌人，造成共计<color=#FF9500>{1}</color>攻击力的火属性伤害。
「虚炎行空」：可通过长按普通攻击施放该技能。贯穿空间施放直线攻击，造成共计<color=#FF9500>220%</color>攻击力的火属性伤害。处于「缚炎」状态时，命中时对敌人附加火属性抗性降低<color=#FF9500>{2}</color>，持续<color=#FF9500>{3}</color>秒。
强化的「虚炎行空」：进入或延长「缚炎」状态时会强化下一次的「虚炎行空」，并且仅处于「缚炎」状态时才可通过长按普通攻击施放该强化技能。把释放的火焰地涌转为对目标的小范围攻击，造成共计<color=#FF9500>660%</color>攻击力的火属性伤害，获得<color=#FF9500>12</color>点能量，命中时对敌人附加火属性抗性降低，持续<color=#FF9500>{4}</color>秒，最多可叠加<color=#FF9500>5</color>层。
「缚炎」状态期间普通攻击命中的次数，「虚炎行空」命中瞬间伤害提高；每次「缚炎」状态结束时移除该伤害提高效果。
「虚炎行空」不会打断普通攻击的连段。

<color=#0068C3>能量：每秒自动获得<color=#FF9500>3</color>点能量。</color>]],
