	[101016101] = {
		description = [[
挥舞荒獠连续攻击，造成共计<color=#FF9500>{1}</color>攻击力的物理伤害。普通攻击到第五段时，长按普通攻击，可施放特殊普通攻击「爆压碎裂斩」，造成共计<color=#FF9500>{2}</color>攻击力的物理伤害，命中后会产生爆炸，每次爆炸造成共计<color=#FF9500>{3}</color>攻击力的物理伤害，每个「压力槽」标记会消耗<color=#FF9500>10</color>点神能并额外产生<color=#FF9500>1</color>次爆炸。「爆压碎裂斩」不会打断普通攻击的连段。
「高压回旋斩」：消耗全部「压力槽」标记并发动回旋斩击，造成共计<color=#FF9500>{4}</color>攻击力的物理伤害，每消耗<color=#FF9500>1</color>个「压力槽」标记获得<color=#FF9500>1</color>层「爆裂阈值」和<color=#FF9500>15</color>点神能，每层「爆裂阈值」自身伤害提高<color=#FF9500>10%</color>，持续<color=#FF9500>{5}</color>秒，施放「高压回旋斩」后的<color=#FF9500>5</color>秒内，施放「突击战术」、「攻坚战术」时会直接施放该技能的电锯模式。
「超频电锯模式」：强化普通攻击，期间不再获得神能，前五段每次攻击命中会消耗<color=#FF9500>10</color>点神能额外造成共计<color=#FF9500>{6}</color>攻击力的物理伤害，当神能不足消耗时退出该状态，该状态最多可持续<color=#FF9500>10</color>秒。

被动：
「压力槽」标记最多拥有<color=#FF9500>4</color>个。

<color=#0068C3>神能：普通攻击命中后会获得神能。</color>]],
