	[101024101] = {
		description = [[
连续攻击，造成共计<color=#FF9500>{1}</color>攻击力的暗属性伤害。
「狼魂」的协同攻击：造成共计<color=#FF9500>{2}</color>攻击力的暗属性伤害。

被动：
「狼魂」会自动攻击其锁定的敌人，随机发动普通攻击的协同攻击或技能的协同攻击，直至敌人被击败。当自身与「狼魂」目标不同，自身施放技能命中时，「狼魂」都会转移目标攻击自身锁定的敌人。「狼魂」发动的协同攻击不视为自身的施放技能。「狼魂」最多在场上存在<color=#FF9500>30</color>秒，当「狼魂」锁定的敌人被击败后，「狼魂」会立即消失。

<color=#0068C3>怒气：普通攻击命中后会获得怒气。</color>]],
