	[101024203] = {
		description = [[
当场上没有「狼魂」时，召唤「狼魂」并攻击自身锁定的敌人，造成共计<color=#FF9500>{1}</color>攻击力的暗属性伤害。「狼魂」已经存在于场上时，该技能会替换为「狼魂凝视」。
「狼魂凝视」：造成共计<color=#FF9500>{2}</color>攻击力的暗属性伤害，「狼魂」会立即对自身锁定的敌人发动协同攻击，技能命中时会触发射线追击，造成共计<color=#FF9500>{4}</color>攻击力的暗属性伤害；「狼魂凝视」有<color=#FF9500>8</color>秒的冷却时间。
