	[101024209] = {
		description = [[
仅当「狼魂」在场上时可以施放。自身与「狼魂」合体，持续<color=#FF9500>15</color>秒，造成共计<color=#FF9500>{1}</color>攻击力的暗属性伤害；施放时全队伍攻击力提高<color=#FF9500>{2}</color>，持续<color=#FF9500>{3}</color>秒；重置自身技能的冷却时间。
与「狼魂」合体期间，技能三会固定替换为「狼魂狂斩」，「狼魂狂斩」有<color=#FF9500>8</color>秒的冷却时间；每次施放普通攻击或技能时，会触发额外攻击造成伤害。
施放普通攻击第一段时，会触发刺击造成共计<color=#FF9500>{8}</color>攻击力的暗属性伤害，刺击每<color=#FF9500>2.5</color>秒最多触发一次。
施放普通攻击其他段时，会触发爪击造成共计<color=#FF9500>{4}</color>攻击力的暗属性伤害。
施放「狼魂疾突」时，额外造成共计<color=#FF9500>{5}</color>攻击力的暗属性伤害，命中时「狼魂疾突」的剩余冷却时间缩短<color=#FF9500>5</color>秒。
施放「狼魂狂舞」时，额外造成共计<color=#FF9500>{6}</color>攻击力的暗属性伤害，命中时「狼魂狂舞」的剩余冷却时间缩短<color=#FF9500>5</color>秒。
施放「狼魂狂斩」时，额外造成共计<color=#FF9500>{7}</color>攻击力的暗属性伤害。

队友、「狼魂」击败敌人或「狼魂」的协同攻击命中时，获得<color=#FF9500>2.5%</color>的奥义值，该效果每<color=#FF9500>2</color>秒最多触发一次。]],
