	[101028101] = {
		description = [[
挥舞「妙尔尼尔」连续攻击，造成共计<color=#FF9500>{1}</color>攻击力的雷属性伤害。在施放衍生技能后衔接普通攻击，会从普通攻击第四段开始攻击，衔接施放时获得硬直效果，持续<color=#FF9500>2</color>秒。

被动：
每段普通攻击命中和每次施放技能命中时会获得「雷势」，「雷势」上限<color=#FF9500>100</color>点，每<color=#FF9500>0.5</color>秒会自动消耗<color=#FF9500>7</color>点。每段普通攻击命中时获得<color=#FF9500>9</color>点「雷势」，每次施放技能命中时获得<color=#FF9500>15</color>点「雷势」，「狂雷」状态期间每次施放技能命中时额外获得<color=#FF9500>15</color>点「雷势」。每有<color=#FF9500>1</color>点「雷势」，独立伤害提高<color=#FF9500>0.3%</color>，「雷势」<color=#FF9500>80</color>点时加成效果达到最高。
施放衍生技能时进入「狂雷」状态，持续<color=#FF9500>2</color>秒，每有<color=#FF9500>1</color>点「雷势」，持续时间延长<color=#FF9500>0.01</color>秒，最多延长<color=#FF9500>1</color>秒。
「狂雷」：进入时获得短暂的无敌效果，状态期间内「雷势」不会自动消耗，雷属性伤害提高<color=#FF9500>{2}</color>。

<color=#0068C3>印记：普通攻击第五段命中敌人后，获得<color=#FF9500>1</color>个印记。</color>]],
