	[101028209] = {
		description = [[
召唤出铁手套「雅恩格利佩尔」，释放怒雷之力。自身进入「怒雷」状态，施放后全队伍印记型修正者技能伤害提高<color=#FF9500>{1}</color>，持续<color=#FF9500>{2}</color>秒。
「怒雷」：状态期间内免疫一切控制与伤害并禁用移动、技能和闪避，根据「雷势」获得的加成效果达到最高。清空「雷势」并不再自动消耗，之后每<color=#FF9500>0.2</color>秒获得<color=#FF9500>7</color>点「雷势」。连续点击攻击会使用铁手套「雅恩格利佩尔」连续施放技能攻击，造成共计<color=#FF9500>{3}</color>攻击力的雷属性伤害，攻击第二段会在前方产生五道落雷，每道落雷造成<color=#FF9500>{4}</color>攻击力的雷属性伤害。「雷势」为满值时会自动施放最后一拳，造成<color=#FF9500>{5}</color>攻击力的雷属性伤害，之后退出「怒雷」状态。

自身或者队友成功消耗印记时，根据消耗的印记数量，每个获得<color=#FF9500>4%</color>的奥义值。]],
