	[101032201] = {
		description = [[
切换巨剑类型，对自身周围的敌人造成<color=#FF9500>{1}</color>攻击力的光属性伤害。普通攻击过程中也可点击该技能直接施放，不会打断普通攻击，也不会造成伤害，之后剩余冷却时间缩短<color=#FF9500>2.5</color>秒。
巨剑类型会按照「巨剑·骑士」、「巨剑·城堡」、「巨剑·皇后」顺序循环切换。

