	[101032202] = {
		description = [[
在目标上方降下巨剑，造成共计<color=#FF9500>{1}</color>攻击力的光属性伤害，获得当前巨剑类型对应的「王棋标记」，并把「王棋」置放在场上，「王棋」持续<color=#FF9500>30</color>秒。「王棋」存在于场上时可再次点击施放该技能，消耗<color=#FF9500>1</color>个印记操纵「王棋」，并根据巨剑类型造成不同的攻击方式。
「巨剑·骑士」：巨剑再次落下，造成共计<color=#FF9500>{2}</color>攻击力的光属性伤害。
