	[101041101] = {
		description = [[
连续挥舞大剑，造成共计<color=#FF9500>{1}</color>攻击力的物理伤害。

被动：
「鸣刃」状态时，每段普通攻击后半程会进行「谐律判定」，在合适的时机衔接下一段攻击，即可判定成功，每次判定成功至判定条结束期间，获得硬直效果。普通攻击判定成功时会产生一次「谐律音爆」，对周围的敌人造成普通攻击伤害，根据「谐律」层数顺序循环造成<color=#FF9500>261.6%、293.6%、329.6%、349.2%、392%、440%、493.8%</color>攻击力的物理伤害。技能判定成功时不会打断普通攻击的连段。

