	[101041203] = {
		description = "神能为满时才可施放，施放后对周围敌人造成共计<color=#FF9500>{4}</color>攻击力的物理伤害，进入「鸣刃」状态，重置「和弦三音」、「促弦五音」的冷却时间，「弦刃协奏」替换为「急弦七音」。\n「鸣刃」：每<color=#FF9500>0.375</color>秒消耗<color=#FF9500>3</color>点神能。神能为<color=#FF9500>0</color>点时，退出「鸣刃」状态，之后「弦刃协奏」进入冷却。状态期间内的「和弦三音」、「促弦五音」、「急弦七音」的后半段也会进行「谐律判定」；每次判定成功都会获得<color=#FF9500>1</color>层「谐律」，持续<color=#FF9500>7</color>秒；判定未成功时会刷新「谐律」的持续时间，「谐律」最多可叠加<color=#FF9500>105</color>层。\n「急弦七音」：造成共计<color=#FF9500>{1}</color>攻击力的物理伤害。「谐律」层数是<color=#FF9500>7</color>的倍数时，「急弦七音」造成共计<color=#FF9500>{3}</color>攻击力的物理伤害，每层「谐律」自身命中瞬间伤害提高<color=#FF9500>1%</color>。施放「急弦七音」判定成功时命中瞬间伤害提高<color=#FF9500>{2}</color>，「急弦七音」有<color=#FF9500>12</color>秒的冷却时间。",
