	[101042101] = {
		description = [[
操作两名人偶进行交替攻击，其中琉刻使用利爪，明塔使用拳甲，造成共计<color=#FF9500>{1}</color>攻击力的暗属性伤害；当琉刻或明塔不可操作时，会直接用丝线进行攻击，造成共计<color=#FF9500>{2}</color>攻击力的暗属性伤害。

