	[101042202] = {
		description = [[
琉刻为当前被操作人偶时，造成共计<color=#FF9500>{1}</color>攻击力的暗属性伤害。维持技能动作时，会对命中的敌人附加「暗海」状态，持续<color=#FF9500>12</color>秒，重复附加时不会刷新持续时间。
明塔为当前被操作人偶时，造成共计<color=#FF9500>{3}</color>攻击力的暗属性伤害。维持技能动作时，会对命中的敌人附加「冥泽」状态，持续<color=#FF9500>8</color>秒，重复附加时不会刷新持续时间。
「暗海」：每<color=#FF9500>2</color>秒附加<color=#FF9500>{2}</color>攻击力的暗属性伤害，持续<color=#FF9500>12</color>秒。
「冥泽」：每<color=#FF9500>2</color>秒附加<color=#FF9500>{4}</color>攻击力的暗属性伤害，持续<color=#FF9500>8</color>秒。
「伴舞」：「冥偶戏·小序曲」会替换为「冥偶戏·圆舞曲」，琉刻和明塔协同攻击，造成共计<color=#FF9500>{5}</color>攻击力的暗属性伤害。]],
