	[101052101] = {
		description = [[
使用怒蛇进行两轮射击，造成共计<color=#FF9500>{1}</color>攻击力的物理伤害，随后呼叫「暴风模式」的无人机进行火力覆盖对前方区域进行最多十二次轰炸，每次轰炸造成<color=#FF9500>{5}</color>攻击力的物理伤害。当拥有「火力覆盖战术」的技能一基础伤害提高的加成效果时，普通攻击最后一段会呼叫「暴风模式」的无人机并向前方翻滚进行连续三次炮击，每次炮击造成<color=#FF9500>{4}</color>攻击力的物理伤害。

被动：
每消耗<color=#FF9500>1</color>点能量会获得<color=#FF9500>1</color>点「火力计数」，「火力计数」上限<color=#FF9500>300</color>点；普通攻击第三段结束时会上膛并可获得<color=#FF9500>40</color>点「火力计数」。「火力计数」为满时，可以长按普通攻击施放「怒蛇咆吼」。
「怒蛇咆吼」：怒蛇射速达到极限向敌人倾泻火力施放技能攻击，每<color=#FF9500>0.2</color>秒消耗<color=#FF9500>12</color>点「火力计数」，最多造成共计<color=#FF9500>{2}</color>攻击力的物理伤害，最多持续<color=#FF9500>5</color>秒，期间无法获得「火力计数」。

<color=#0068C3>能量：每秒自动获得<color=#FF9500>2</color>点能量，普通攻击和「怒蛇咆吼」每次命中获得<color=#FF9500>{3}</color>点能量。</color>]],
