	[101052201] = {
		description = "使用怒蛇对敌人进行连续三次炮击，每次炮击造成<color=#FF9500>{1}</color>攻击力的物理伤害。每次炮击命中后，全队伍技能一基础伤害提高<color=#FF9500>5%</color>，持续<color=#FF9500>5</color>秒，每次叠加刷新并延长<color=#FF9500>1</color>秒，最多可叠加<color=#FF9500>3</color>层。每次炮击获得<color=#FF9500>{2}</color>点能量。技能施放结束时，根据未释放的炮击次数该技能的剩余冷却时间缩短，每少释放一次炮击，该技能的剩余冷却时间缩短<color=#FF9500>20%</color>。能量为满时，该技能会替换为「火力支援战术」。\n「火力支援战术」：消耗<color=#FF9500>30</color>点能量，呼叫远程炮火轰炸前方区域，造成共计<color=#FF9500>{3}</color>攻击力的物理伤害；施放「怒蛇咆吼」且能量为满时会自动消耗能量并施放「火力支援战术」。",
