	[101058101] = {
		description = [[
连续挥舞大太刀斩击敌人，造成共计<color=#FF9500>{1}</color>攻击力的火属性伤害。每次攻击命中，自身受到的伤害降低<color=#FF9500>{2}</color>，持续<color=#FF9500>{3}</color>秒，最多可叠加<color=#FF9500>10</color>层。

被动：
「烬祸·焚涅」、「秘剑·焚涅」、「烬祸·牙突」、「秘剑·牙突」、「烬祸·熔火」命中后<color=#FF9500>7</color>秒内下一次点击普通攻击会施放技能「绯狱舞炎·改」。
