	[101070201] = {
		description = [[
挥舞十曜连续斩击目标，造成共计<color=#FF9500>{1}</color>攻击力的火属性伤害。当拥有「曜」标记时，每次斩击命中后会消耗<color=#FF9500>1</color>个「曜」标记，获得<color=#FF9500>1</color>层「火羽」，每层「火羽」自身技能伤害提高<color=#FF9500>2%</color>，持续<color=#FF9500>{2}</color>秒，最多可叠加<color=#FF9500>12</color>层。当拥有<color=#FF9500>9</color>个「曜」标记时，施放时会消耗全部「曜」标记，获得<color=#FF9500>9</color>层「火羽」，并额外造成共计<color=#FF9500>{3}</color>攻击力的火属性伤害。
处于「日凌」状态时，该技能会替换为「金乌炽空」；退出「日凌」状态时，该技能会替换为「降妖斩决」。
「金乌炽空」：在空中挥舞十曜攻击目标，消耗<color=#FF9500>3</color>个「曜」标记，造成共计<color=#FF9500>{4}</color>攻击力的火属性伤害；当拥有<color=#FF9500>9</color>个「曜」标记时，则会消耗全部「曜」标记。

<color=#0068C3>神能：当拥有<color=#FF9500>9</color>个「曜」标记时，施放「降妖斩决」会消耗全部「曜」标记，获得<color=#FF9500>25</color>点神能；「降妖斩决」的斩击每次攻击命中后，会消耗<color=#FF9500>1</color>个「曜」标记，获得<color=#FF9500>5</color>点神能，并且根据该次技能施放累积消耗的「曜」标记额外获得神能，每累积消耗<color=#FF9500>1</color>个「曜」标记，额外获得<color=#FF9500>1</color>点神能。当拥有<color=#FF9500>9</color>个「曜」标记时，施放「金乌炽空」会消耗全部「曜」标记，获得<color=#FF9500>80</color>点神能；当拥有「曜」标记不满<color=#FF9500>9</color>个时，「金乌炽空」会消耗<color=#FF9500>3</color>个「曜」标记，获得<color=#FF9500>20</color>点神能。</color>]],
