	[101070203] = {
		description = [[
消耗全部神能，对周围造成共计<color=#FF9500>{1}</color>攻击力的火属性伤害，从地面腾空进入「日凌」状态。
「日凌」：获得硬直效果，闪避值消耗降低<color=#FF9500>100%</color>；进入时每消耗<color=#FF9500>1</color>点神能自身获得<color=#FF9500>1</color>层火属性伤害提高效果，每层自身火属性伤害提高<color=#FF9500>0.1%</color>，持续至退出「日凌」状态。连续施放技能或闪避，动作期间可维持「日凌」状态，停止施放后即可回到地面；回到地面时退出「日凌」状态，之后该技能进入冷却。
处于「日凌」状态时，该技能会替换为「金乌焚陨」；改变「蓬莱剑法」的攻击模式；退出「日凌」状态时，该技能会替换为「三足逐日」。
「蓬莱剑法」：施放技能攻击驱使曜刃攻击目标，造成共计<color=#FF9500>{2}</color>攻击力的火属性伤害，每命中敌人<color=#FF9500>4</color>次，获得<color=#FF9500>1</color>个「曜」标记。
「金乌焚陨」：朝锁定的敌人俯冲，命中时消耗全部「曜」标记，造成共计<color=#FF9500>{3}</color>攻击力的火属性伤害，每消耗<color=#FF9500>1</color>个「曜」标记，该技能的基础伤害提高<color=#FF9500>3%</color>，之后退出「日凌」状态。]],
