	[101071201] = {
		description = [[
脱胎于太昊剑法的身法之一，借助此身法可快速穿行于战场，亦可凌厉破敌。
处于「青巽」姿态：施放「风雷引」，急速后撤，造成共计<color=#FF9500>{1}</color>攻击力的风属性伤害。「风雷引」处于冷却状态时，会替换为「风雷突」，「风雷突」有<color=#FF9500>3</color>秒的冷却时间。
「风雷突」：急速突进，造成共计<color=#FF9500>{2}</color>攻击力的风属性伤害，命中时会消耗全部「勿」标记，每消耗<color=#FF9500>1</color>个「勿」标记，召唤一把「玉剑」攻击锁定的敌人。
切换至「苍震」姿态时，该技能会替换为「风雷破」；切换至「青巽」姿态时，该技能会替换为「风雷引」。
「风雷破」：消耗<color=#FF9500>3</color>点神能，神能不足时会消耗全部神能，造成共计<color=#FF9500>{3}</color>攻击力的雷属性伤害，该技能有<color=#FF9500>2</color>秒的冷却时间。可以在施放「益动势合·震」或「恒出运昌·震」的过程中可以穿插施放该技能，穿插施放时会改变攻击模式并改变「益动势合·震」或「恒出运昌·震」的后续伤害，衍生出更强力的招式；穿插施放时，「风雷破」、「益动势合·震」和「恒出运昌·震」的剩余冷却时间分别缩短<color=#FF9500>99%</color>、<color=#FF9500>40%</color>和<color=#FF9500>40%</color>；穿插施放后，下一次直接施放该技能时会改变攻击模式、不会进入冷却也不会打断普通攻击的段数。

<color=#0068C3>神能：处于「青巽」姿态时，每命中敌人<color=#FF9500>1</color>次，获得<color=#FF9500>10</color>点神能。</color>]],
