	[101071203] = {
		description = [[
脱胎于太昊剑法的第二种剑术法门，造化恒常，刚柔相济。
处于「青巽」姿态：该技能替换为「恒出运昌·巽」。神能达到满值后才可施放，踢出飞剑造成共计<color=#FF9500>{1}</color>攻击力的风属性伤害，飞剑飞行过程召唤最多<color=#FF9500>8</color>道「云雷」攻击沿途敌人，随后接住飞剑重新丢出，自身切换为「苍震」姿态、移除全部「勿」标记、重置「恒出运昌·震」的冷却时间，再次丢出的飞剑在第一个命中的敌人位置造成共计<color=#FF9500>{7}</color>攻击力的雷属性伤害，召唤<color=#FF9500>6</color>道「云雷」攻击区域内的目标，并小幅聚集敌人。当神能为<color=#FF9500>0</color>时，自身切换为「青巽」姿态。
「云雷」：造成<color=#FF9500>{2}</color>攻击力的雷属性伤害。
处于「苍震」姿态：该技能替换为「恒出运昌·震」。消耗<color=#FF9500>15</color>点神能，神能不足时会消耗全部神能，施放三段攻击造成伤害，最后一段攻击在前方区域召唤<color=#FF9500>10</color>道「云雷」，根据穿插「风雷破」的时机，又演化出四式剑术，造成不同的伤害。
第一式：直接施放，造成共计<color=#FF9500>{3}</color>攻击力的雷属性伤害；
第二式：仅在第二段前穿插施放「风雷破」，最多造成共计<color=#FF9500>{4}</color>攻击力的雷属性伤害；
第三式：仅在第三段前穿插施放「风雷破」，最多造成共计<color=#FF9500>{5}</color>攻击力的雷属性伤害；
第四式：在第二段前和第三段前都穿插施放「风雷破」，最多造成共计<color=#FF9500>{6}</color>攻击力的雷属性伤害。]],
