	[101075101] = {
		description = [[
陵光参悟南方七宿和离卦习得的御火秘法。
造成共计<color=#FF9500>{1}</color>攻击力的火属性伤害。在施放任一技能的「起式」、「燃式」后衔接普通攻击，会从普通攻击第四段开始攻击；施放技能「离行不息·起式」、「晋照升明·起式」时可以点击普通攻击打断技能并衔接普通攻击第四段。

被动：
普通攻击第四段或第五段命中时、施放「天同人和·起式」或「天同人和·燃式」命中时，「离行不息」和「晋照升明」会在「起式」、「燃式」之间切换。
施放技能后<color=#FF9500>10</color>秒内，再次施放技能时判定为连续施放；连续施放<color=#FF9500>4</color>个技能后，进入「烈离」状态，持续<color=#FF9500>10</color>秒。
「烈离」：状态期间所有技能统一切换为「烈式」，并且仅可以施放其中的任意一个，状态结束时所有技能切换为「起式」。
「烈式」的加成效果最多可以存在<color=#FF9500>2</color>个。

<color=#0068C3>印记：普通攻击第五段命中敌人时，获得<color=#FF9500>1</color>个印记。</color>]],
