	[101075202] = {
		description = [[
脱胎于天南法门的御火功法之一，由于天南法门的特点，实战中有三式。
「起式」：挥舞折扇攻击前方敌人，造成共计<color=#FF9500>{1}</color>攻击力的火属性伤害。
「燃式」：后跃并留下旋转的折扇攻击敌人，造成共计<color=#FF9500>{2}</color>攻击力的火属性伤害。
「烈式」：消耗<color=#FF9500>4</color>个印记，对自身周围造成共计<color=#FF9500>{3}</color>攻击力的火属性伤害。施放时全队伍获得「烬火」。
「烬火」：生命值不高于<color=#FF9500>70%</color>时，命中瞬间伤害上升<color=#FF9500>4%</color>，生命值每比<color=#FF9500>70%</color>低<color=#FF9500>1%</color>额外上升<color=#FF9500>0.4%</color>，最高<color=#FF9500>{4}</color>。

<color=#0068C3>印记：「起式」或「燃式」攻击命中后，获得<color=#FF9500>1</color>个印记。</color>]],
