	[101075203] = {
		description = [[
脱胎于天南法门的御火功法之一，由于天南法门的特点，实战中有三式。
「起式」：挥舞折扇同时突进攻击前方大范围的敌人，造成共计<color=#FF9500>{1}</color>攻击力的火属性伤害，命中后，该技能切换为「燃式」。
「燃式」：交叉挥舞两把折扇攻击前方大范围的敌人，造成共计<color=#FF9500>{2}</color>攻击力的火属性伤害，命中后，该技能切换为「起式」。
「烈式」：消耗<color=#FF9500>4</color>个印记，对自身周围造成共计<color=#FF9500>{3}</color>攻击力的火属性伤害。施放时全队伍获得「煌焰」。
「煌焰」：生命值不低于<color=#FF9500>50%</color>时，命中瞬间伤害上升<color=#FF9500>4%</color>，生命值每比<color=#FF9500>50%</color>高<color=#FF9500>1%</color>额外上升<color=#FF9500>0.4%</color>，最高<color=#FF9500>{4}</color>。

<color=#0068C3>印记：「起式」或「燃式」攻击命中后，获得<color=#FF9500>1</color>个印记。</color>]],
