	[101081101] = {
		description = [[
挥动斩浪号上搭载的斩舰刃，配合武装连续进攻敌人，造成共计<color=#FF9500>{1}</color>攻击力的冰属性伤害。普通攻击任意一段后都可通过长按衔接施放蓄力技能攻击「霜断」。由于斩浪号的存在，自身不会受到击飞影响。
「霜断」：造成共计<color=#FF9500>{2}</color>攻击力的冰属性伤害。
处于「巡航模式」时，施放普通攻击会自动锁定目标并发射二枚利剑式跟踪导弹，每一枚跟踪导弹能造成<color=#FF9500>{3}</color>攻击力的冰属性伤害，当锁定的敌人处于冰冻状态时会额外发射两枚跟踪导弹。

<color=#0068C3>神能：非「巡航模式」时，普通攻击与「霜断」命中后会获得神能；「巡航模式」时，移动与漂移都会获得神能。</color>]],
