	[101094203] = {
		description = "迟钝转变为炮垒形态，可持续对瞄准方向进行炮击，每次炮击消耗<color=#FF9500>20</color>点神能，造成共计<color=#FF9500>{1}</color>攻击力的暗属性伤害，炮击神能消耗不受其他属性影响。\n在炮垒形态下免疫控制效果，禁用移动、技能和自身奥义，仅可进行左右旋转瞄准；自身受到的伤害降低<color=#FF9500>20%</color>，每受到生命值上限<color=#FF9500>1%</color>的伤害时会消耗<color=#FF9500>1</color>点神能；当神能不足或点击取消时会退出炮垒形态。",
