	[101111209] = {
		description = [[
短暂解开灵魂束缚进入「冥府审判模式」，自身生命值恢复至满值。
「冥府审判模式」：改变「空冥镰斩」、「幽岚羽刃」、「永劫轮舞」、「终灵凋落」的攻击模式。全队伍伤害提高<color=#FF9500>{1}</color>。自身获得霸体效果和每秒<color=#FF9500>7%</color>生命值上限的生命移除状态，当生命值为<color=#FF9500>0</color>时退出「冥府审判模式」，恢复至原本状态。
