	[101119201] = {
		description = [[
挥舞长枪，造成共计<color=#FF9500>{1}</color>攻击力的雷属性伤害，在进攻姿态和防御姿态之间进行切换。
无论「风雷易势」是否处于冷却、是否替换为「风雷流转」，在施放「雷鸣风啸」、「奔雷疾风」、「风雷流转」或者追击、反击过程中可以直接点击该技能进行姿态切换，不会打断当前动作也不会造成伤害，这之后消耗<color=#FF9500>7</color>点怒气。
处于防御姿态时，施放「雷鸣风啸」、「奔雷疾风」过程中受击时会格挡当前的伤害并触发反击，反击造成共计<color=#FF9500>{4}</color>攻击力的雷属性伤害，命中后获得<color=#FF9500>1</color>个「惊岚」标记，这之后消耗<color=#FF9500>15</color>点怒气。
当标记为满时，「风雷易势」会替换为「风雷流转」，攻击姿态和防御姿态的「风雷流转」分别有<color=#FF9500>15</color>秒的冷却时间。
「风雷流转」：处于进攻姿态时，消耗全部标记，造成共计<color=#FF9500>{2}</color>攻击力的雷属性伤害；处于防御姿态时，消耗全部标记，造成共计<color=#FF9500>{3}</color>攻击力的雷属性伤害。]],
