	[101127203] = {
		description = [[
印记不满<color=#FF9500>4</color>个时，点击施放可获得<color=#FF9500>1</color>个印记。自身印记为满<color=#FF9500>4</color>个时，「暗潮之力」会替换为「深海愈疗」。
「深海愈疗」：解放权钥的力量展开愈疗之环，消耗全部印记，恢复附近所有友方自身<color=#FF9500>{1}</color>的攻击力的生命值；「深海愈疗」有<color=#FF9500>3</color>秒的冷却时间。施放「深海愈疗」时会消耗全部标记，获得额外的技能效果。
消耗「逆潮」标记时，对锁定的敌人造成共计<color=#FF9500>{2}</color>攻击力的水属性伤害，自身每有<color=#FF9500>1%</color>治疗效果提高，该次攻击命中瞬间伤害提高<color=#FF9500>1.25%</color>，该效果提供的伤害提高最高为<color=#FF9500>100%</color>。
消耗「鲸歌」标记时，附近所有友方受到的伤害降低，自身每有<color=#FF9500>1%</color>会心伤害提高，受到的伤害降低提高<color=#FF9500>0.12%</color>，该效果提供的受到的伤害降低最高为<color=#FF9500>15%</color>，持续<color=#FF9500>{3}</color>秒。]],
