	[101132203] = {
		description = "将长剑向目标位置掷出并持续旋转，自身切换为「炽甲」姿态。命中第一个敌人时旋转长剑会在停留在该位置并持续造成范围伤害，每<color=#FF9500>0.5</color>秒造成<color=#FF9500>{1}</color>攻击力的火属性伤害，最多可持续<color=#FF9500>10</color>秒，持续时间结束后，旋转长剑消失，自身切换为「燃剑」姿态，之后该技能进入冷却。\n旋转长剑在目标位置持续旋转时，可再次点击该技能，旋转长剑会返回。接住旋转长剑后自身切换为「燃剑」姿态，长剑与拳甲合并施放强力攻击，造成<color=#FF9500>{2}</color>攻击力的火属性伤害，施放强力攻击时自身免疫控制与伤害，之后该技能进入冷却。",
