		description = "施放「零度寒芒」或「事象冰封」后，施放「银雪回响」会重复施放上一技能并获得对应的「若雪」或「寒封」标记，该次施放会附加对应技能的「追加吟唱」攻击。拥有<color=#FF9500>2</color>个任意标记时，「银雪回响」会替换为「银雪星霜」。\n「银雪星霜」：施放时消耗全部标记并获得对应效果，向锁定方向发射三道星霜，对路径上的敌人造成共计<color=#FF9500>{1}</color>攻击力的冰属性伤害，重置「零度寒芒」和「事象冰封」的冷却时间，进入「临渊」状态，持续<color=#FF9500>8</color>秒。\n「临渊」：状态期间内禁用技能三，无法获得「若雪」或「寒封」标记；施放「零度寒芒」或「事象冰封」时会附加对应技能的「追加吟唱」攻击。",
