	[101139209] = {
		description = [[
召唤多个冰柱攻击锁定的敌人，造成共计<color=#FF9500>{1}</color>攻击力的冰属性伤害；根据当前拥有的标记的种类和数量，全队伍技能一和技能二的剩余冷却时间缩短。
