	[101199203] = {
		description = [[
使用拔刀术斩击前方敌人，命中处于「雷殛之印」的敌人时，清除「雷殛之印」并开启「雷殛·荒天」的下一式，「雷殛·荒天」共有三式，第三式施放时不会消耗怒气，也不会清除「雷殛之印」。
「雷殛·荒天」第一式：造成共计<color=#FF9500>{1}</color>攻击力的雷属性伤害。
「雷殛·荒天」第二式：造成共计<color=#FF9500>{2}</color>攻击力的雷属性伤害。
「雷殛·荒天」第三式：施放四道落雷，单次落雷造成<color=#FF9500>{3}</color>攻击力的雷属性伤害，后续的落雷对同个敌人伤害依次衰减，对同个敌人最多造成<color=#FF9500>2.8×{3}</color>攻击力的雷属性伤害。]],
