	[200000028] = {
		description = "施放「炙炼侵袭」将长剑抛掷出去后，再次点击该技能键不再使旋转的长剑飞回，而是瞬移到旋转的长剑处收回长剑。接住长剑后的强力攻击施放时，获得<color=#ED6117>100</color>点「烙印」。越早收回长剑，「炙炼侵袭」的剩余冷却时间缩短越多，该效果提供的剩余冷却时间缩短最高为<color=#ED6117>12</color>秒。",
