	[200000029] = {
		description = "处于「燃剑」姿态时，每次普通攻击命中时，「炙炼侵袭」的剩余冷却时间缩短<color=#ED6117>0.5</color>秒。\n处于「炽甲」姿态时，施放「爆裂强攻」会消耗全部怒气、全部「烙印」，每消耗<color=#ED6117>1</color>点怒气，基础伤害提高<color=#ED6117>{1}</color>，消耗「烙印」时基础伤害也会提高；施放奥义后，重置「炙炼侵袭」的冷却时间。",
